import React, { useState, useEffect } from 'react';
import { createHome, listRealtors } from '../utils/api'; // Import listRealtors function
import { useNavigate } from 'react-router-dom';

function AddHomeForm({ onHomeAdded }) { // Remove 'realtors' from the parameter list
    const navigate = useNavigate();
    const [newHome, setNewHome] = useState({
        price: '',
        image_url: '',
        address: '',
        about: '',
        registered: '',
        realtor_id: ''
    });
    const [realtors, setRealtors] = useState([]);

    useEffect(() => {
        const fetchRealtors = async () => {
            try {
                const realtorsData = await listRealtors(); // Use listRealtors function to fetch realtors
                setRealtors(realtorsData);
            } catch (error) {
                console.error('Error fetching realtors:', error);
            }
        };

        fetchRealtors();
    }, []);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setNewHome((prevHome) => ({
            ...prevHome,
            [name]: value,
        }));
    };

    const handleRealtorChange = (e) => {
        const selectedRealtorId = e.target.value;
        setNewHome((prevHome) => ({
            ...prevHome,
            realtor_id: selectedRealtorId,
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        try {
            // Make an API request to create a new home
            const createdHome = await createHome(newHome);
            // Call the callback function to notify the parent component of the new home
            onHomeAdded(createdHome);
            // Clear the form
            setNewHome({
                price: '',
                image_url: '',
                address: '',
                about: '',
                registered: '',
                realtor_id: ''
            });
            navigate('/');
        } catch (error) {
            console.error('Error creating home:', error);
        }
    };
    return (
        <form onSubmit={handleSubmit}>
            <div>
                <label htmlFor="price">Price:</label>
                <input
                    type="text"
                    id="price"
                    name="price"
                    value={newHome.price}
                    onChange={handleChange}
                    required
                />
            </div>
            <div>
                <label htmlFor="image_url">Image URL:</label>
                <input
                    type="text"
                    id="image_url"
                    name="image_url"
                    value={newHome.image_url}
                    onChange={handleChange}
                    required
                />
            </div>
            <div>
                <label htmlFor="address">Address:</label>
                <input
                    type="text"
                    id="address"
                    name="address"
                    value={newHome.address}
                    onChange={handleChange}
                    required
                />
            </div>
            <div>
                <label htmlFor="about">About:</label>
                <textarea
                    id="about"
                    name="about"
                    value={newHome.about}
                    onChange={handleChange}
                    required
                />
            </div>
            <div>
                <label htmlFor="registered">Registered:</label>
                <input
                    type="text"
                    id="registered"
                    name="registered"
                    value={newHome.registered}
                    onChange={handleChange}
                    required
                />
            </div>
            <div>
                <label htmlFor="realtor_id">Realtor:</label>
                <select
                    id="realtor_id"
                    name="realtor_id"
                    value={newHome.realtor_id}
                    onChange={handleRealtorChange}
                    required
                >
                    <option value="">Select a Realtor</option>
                    {realtors.map((realtor) => (
                        <option key={realtor.id} value={realtor.id}>
                            {realtor.email}
                        </option>
                    ))}
                </select>
            </div>
            <button type="submit">Add Home</button>
        </form>
    );
}


export default AddHomeForm;
